INSERT INTO `cps_article` VALUES (1, 0, '活动公告', '', '', '', '', '<p style=\"-webkit-tap-highlight-color: transparent; outline-style: initial; outline-width: 0px; padding: 0px; vertical-align: baseline; font-size: 16px; color: rgb(51, 51, 51); font-family: -apple-system, Helvetica, sans-serif; widows: 1;\">1、活动时间：2017年1月1日 00:00:00-12月31日 23:59:59；</p><p style=\"-webkit-tap-highlight-color: transparent; outline-style: initial; outline-width: 0px; margin-top: 0px; padding: 0px; vertical-align: baseline; font-size: 16px; color: rgb(51, 51, 51); font-family: -apple-system, Helvetica, sans-serif; widows: 1;\">2、188元新人大礼包由新注册用户礼包和实名认证礼包组成；</p><p style=\"-webkit-tap-highlight-color: transparent; outline-style: initial; outline-width: 0px; margin-top: 0px; padding: 0px; vertical-align: baseline; font-size: 16px; color: rgb(51, 51, 51); font-family: -apple-system, Helvetica, sans-serif; widows: 1;\">3、188元新人大礼包仅限于拥有京东购物平台正式账号且未发生购买行为的新用户领取。新用户在完成手机验证后，即有机会获得新注册用户礼包；完成手机验证的新用户完成实名身份认证后（实名认证需要京东验证姓名、身份证、银行卡及银行卡预留手机号等信息），即有机会获得实名认证礼包。礼包数量有限，先到先得，发完即止；</p><p style=\"-webkit-tap-highlight-color: transparent; outline-style: initial; outline-width: 0px; margin-top: 0px; padding: 0px; vertical-align: baseline; font-size: 16px; color: rgb(51, 51, 51); font-family: -apple-system, Helvetica, sans-serif; widows: 1;\">4、短信验证时，短信验证手机号码与京东账号绑定号码必须一致，操作时请注意查收系统发送的短信信息；</p><p style=\"-webkit-tap-highlight-color: transparent; outline-style: initial; outline-width: 0px; margin-top: 0px; padding: 0px; vertical-align: baseline; font-size: 16px; color: rgb(51, 51, 51); font-family: -apple-system, Helvetica, sans-serif; widows: 1;\">5、同一个京东账号、手机号视为同一用户，每个用户仅可获取一次礼包权益。优惠券的具体面额及有效期以实际到账为准，优惠券的有效期及使用方法请到“个人中心-我的钱包-优惠券”查看。优惠券过期未使用将自动失效，请及时使用；</p><p style=\"-webkit-tap-highlight-color: transparent; outline-style: initial; outline-width: 0px; margin-top: 0px; padding: 0px; vertical-align: baseline; font-size: 16px; color: rgb(51, 51, 51); font-family: -apple-system, Helvetica, sans-serif; widows: 1;\">6、在获取和使用优惠券过程中，如出现违规行为（如作弊领取、恶意套取、虚拟交易等），京东有权撤销违规交易，收回优惠券礼包；如遇不可抗力（包括但不限于重大灾害事件、活动受政府机关指令需要停止举办或调整的、活动中存在大面积作弊行为、活动遭受网络攻击或因系统故障导致活动领券资格大批出错，活动不能正常进行的），京东可取消、修改或暂停本活动，则活动主办方可依相关法律法规主张免责；</p><p style=\"-webkit-tap-highlight-color: transparent; outline-style: initial; outline-width: 0px; margin-top: 0px; padding: 0px; vertical-align: baseline; font-size: 16px; color: rgb(51, 51, 51); font-family: -apple-system, Helvetica, sans-serif; widows: 1;\">7、京东保留在法律规定范围内对上述规则进行解释的权利。</p>', '2017-09-02 14:24:28', 0, 0, 0, 1, '', '', '', 0, 1, '2017-09-02 14:24:28', 1, '', NULL, NULL, NULL);
